import React from 'react'
import img1 from './images/img1.jpg';
import './Home.css';
function Home() {
  return (
    <>
            <div className='img'>
            <img src = {img1} alt="" />
            <p className='intro'>Neha Shah</p>
            </div>
     
    </>
  )
}

export default Home
